import './PokeType.css'
const POKEMON_TYPES_COLOR_PALLETE = {
    normal: "#A8A77A",
    fire: "#EE8130",
    water: "#6390F0",
    electric: "#F7D02C",
    grass: "#7AC74C",
    ice: "#96D9D6",
    fighting: "#C22E28",
    poison: "#A33EA1",
    ground: "#E2BF65",
    flying: "#A98FF3",
    psychic: "#F95587",
    bug: "#A6B91A",
    rock: "#B6A136",
    ghost: "#735797",
    dragon: "#6F35FC",
    dark: "#705746",
    steel: "#B7B7CE",
    fairy: "#D685AD",
  };

const PokeType = ({types}) => {
    console.log(types)
    return (
    <div className='container'>
        <p className='text'>Types</p>
        <div className='container2'>
        <span >
            {types && types.map((el) => {
                return(
                <p
                className= "button"
                style={{backgroundColor: `${el.type.name}`}}
                >
                    {`${el.type.name}`}
                </p>
                )   
            })}
        </span>
        </div>
    </div>
    )
}

export default PokeType
